/* eslint-disable react/prop-types */
import React from 'react';

const Note = (props) => {
  return (
    <div className="note">
      <h1>{props.title}</h1>
      <p>{props.content}</p>
    </div>
  );
};

const GetNotes = (props) => {
  return <Note key={props.key} title={props.title} content={props.content} />;
};

export default GetNotes;
